// --- 1. GET DATA FROM ALL PREVIOUS STEPS ---

// Get the Printify product data (variants with their Printify IDs and titles)
const printifyProduct = $('Create_Printify_Product').item.json;
// Get the Shopify product data (variants with their Shopify IDs and titles)
const shopifyProduct = $('Search_ShopifyProduct').item.json.data.products.edges[0]?.node;
// Get the list of all constructed mockup URLs
const allCuratedImageUrls = JSON.parse($('Preserve_Product_Data').item.json.curated_image_url);

if (!shopifyProduct) {
  throw new Error("Could not find Shopify product from GraphQL search. Stopping.");
}

// --- 2. CREATE LOOKUP MAPS ---

// Map Shopify variant titles (e.g., "Black / S") to their numeric Shopify IDs
const shopifyVariantMap = new Map();
for (const edge of shopifyProduct.variants.edges) {
  const shopifyId = edge.node.id.split('/').pop();
  shopifyVariantMap.set(edge.node.title, shopifyId);
}

// --- 3. PREPARE THE UPLOAD TASKS ---

const uploadTasks = [];
const blueprintId = $('Prepare_Printify_Product_Payload').item.json.blueprint_id;
const isPerVariant = [937, 635, 764].includes(blueprintId); // Mugs, Canvases, Posters

if (isPerVariant) {
  // Logic for Mugs, Canvases, etc., where each image belongs to one variant

  // Map Printify variant IDs to their titles
  const printifyVariantTitleMap = new Map();
  printifyProduct.variants.forEach(v => printifyVariantTitleMap.set(v.id, v.title));

  for (const imageUrl of allCuratedImageUrls) {
    // Extract the Printify variant ID from the image URL
    const printifyVariantId = parseInt(imageUrl.split('/')[5], 10);
    const variantTitle = printifyVariantTitleMap.get(printifyVariantId);

    if (variantTitle && shopifyVariantMap.has(variantTitle)) {
      const shopifyVariantId = shopifyVariantMap.get(variantTitle);
      uploadTasks.push({
        imageUrl: imageUrl,
        shopifyVariantIds: [shopifyVariantId] // Assign this image to ONLY ONE variant
      });
    }
  }
} else {
  // Logic for T-shirts, where all images apply to all variants
  const allShopifyVariantIds = Array.from(shopifyVariantMap.values());
  for (const imageUrl of allCuratedImageUrls) {
    uploadTasks.push({
      imageUrl: imageUrl,
      shopifyVariantIds: allShopifyVariantIds // Assign this image to ALL variants
    });
  }
}

// Pass along the upload tasks and the Shopify Product ID
return uploadTasks.map(task => ({
  json: {
    ...task,
    restProductId: shopifyProduct.id.split('/').pop()
  }
}));

